import './App.css';

function App() {
  return (
    <div className="bg-blend-lighten hover:bg-blend-darken">
       <div className="bg-gradient-to-r from-green-400 to-blue-500 p-6 rounded-lg shadow-xl">
         <ul className="space-y-4 flex flex-row justify-evenly">
            <li className="text-2xl font-bold">Home</li>
           <li className="text-2xl font-bold">Services</li>
           <li className="text-2xl font-bold">Projects</li>
            <li className="text-2xl font-bold">Contact</li>
          </ul>
      </div>
    </div>
  );
}

export default App;
